import  {React , useReducer}   from 'react' ;

import "./App.css" ;

const x = 0;

const reducer = (state , action) => {
  switch (action) {
    case "inc" :
        return state + 1 ;
    case "dec" :
        return state - 1 ;
    case "dbl" :
        return state * 2 ;
    case "half" :
        return state / 2 ; 
    case "reset" :
        return x ;
    default :
    return state;                 
  }
}

function App() {
   const [count , dispatch] = useReducer (reducer , x) ;
  return (
          <div>
           <h1> number is {count} </h1>
           <button onClick={()=> dispatch("inc")}> </button>
           <button onClick={()=> dispatch("dec")}> </button>
           <button onClick={()=> dispatch("dbl")}> </button>
           <button onClick={()=> dispatch("half")}> </button>
           <button onClick={()=> dispatch("reset")}> </button>

          </div>
  )
}


export default App;
